Ana este pianista si compozitoare. E tinara, are o pozitie sociala de invidiat, proiecte muzicale diverse si multa energie. Locuieste intr-o casa mare, decorata minimalist, in alb si negru, intr-o zona rezidentiala.
Un necunoscut ii da de la distanta paradoxale dovezi de dragoste. Sint mesaje ironice, cadouri neasteptate, manipulari inteligente. Toate semnalele care vin din partea lui au ceva in comun : culoarea albastra si o nuanta moralizatoare.
Ritualul sau de seductie e mai degraba o defilare a puterii, dar si a inteligentei sale : caci e suficient ca Ana sa-si doreasca ceva si peste putin timp acel &quot;ceva&quot;, va fi al ei.

